content:
이홍도!  작가 몰래 우물에라도 실수로 한 번 빠지거라!!!
뱀신이 보고프다!
그리기 힘들다고 출연을 안 시켜줘... - -;

책임전가하는 하느님의 기도라는건 참 비겁한 인간들이 택한 최악의 방법중 하나인거 같다. 

'예수의 느꼈다는 목사들의 감언이설아래 기도를 하며 노래부르면 모든 죄가 사하야 천국에 나만 들어갈 수 있다' 거대한 교회의 건물안에서 있을 수 있다면 나는 무사히 천국에 갈 수 있어. &quot;

아둔함의 극치다.

엮긴 일행인(?):어딘지 알고 가십니까? 
강의신: 아니;;;((삐질삐질))
엮긴 일행인(?): ;;;;

홍도가 주술자 중에서도 유난히 힘이 강해서 피만으로도 인어가 저 정도로 진화 한것 같네요 ;;;
홍도도 분명히, &quot;그래, 니가 날 어느 정도까지 소화 시킬 수 있는지 어디 보자&quot; 나고 했으니 맞을 듯 하네요.

인어 경우는 통이 너무 작아서 더 커지기 전에 더 큰 바닷물(?)로 피한것 같고요.

1. 왜 홍도는 권속을 거절하나요? 홍도한테 좋은거 아닌가;
2. 왜 물뱀은 권속을 원하나요? 자유로운게 좋은거 아닌가;
3. 홍도의 피를 먹고 인어는 커진건가요? 소화해낸다는게 홍도의 피를 소화하는건가?
4. 그림체가 어떻게 이렇게 예쁠수가 있나요??
아시는 분 답변부탁해용

급 궁금해지는데요~
여주는 자신이 다쳤을때 재생능력도 있을까요?!
흠.. 보다보면 나오겠죠?! ㅎㅎ^^;;;;;

내가 이나이에 ...이런 그림체의 웹툰을 보게될줄이야...ㄷㄷㄷ;;;
볼땐 항상 숨어서 보는중....
난 로리가 아니란말이야! 으아아아아아아아

나도 청우 행동 개별로;
아무리 좋아하는 친구라도 저렇게 붙잡고 밀치고 입술도 만지고 지혼자 미치겟다~ 거리는데 읭? 뭐지 저샛기는? 싶지
좋지는 않을거 같은데

근데 양동이는 진짜 살인미수 아님..?
짝사랑하는 사람이 좋아하는 사람을 괴롭히는 것도 이해 안 가는데
괴롭히는 정도도 과해서... 좀 제정신 아닌거 같음;
